window.bookSummaryJSON = "<p>Exiled by his power-hungry brothers, Prince Tarkyn encounters the woodfolk: a secretive group of telepaths living deep in the woodlands.</p> <p>When bounty hunters attack, Tarquin narrowly escapes with the aid of the forest-dwellers and discovers a secret about their source of magic.&nbsp;</p> <p>Embracing his new identity, allegiances are formed as the woodfolk hail Tarquin as the guardian of the forest.</p> <p>But can he find a way to protect this mysterious realm and seize his true destiny?</p>"; 
